import React from 'react';
import logo from './logo.svg';
import './App.css';

import { BrowserRouter as Router, Route, Switch, Link, Redirect } from 'react-router-dom'

//pages
import MainPage from './pages'



function App() {
  return (
    <div className="App">
      <p> PayDay </p>
      <Router> 
        <Route path="/" component={MainPage}></Route> 
      </Router>
    </div>
  );
}

export default App;
